import React, { useContext } from 'react';
import './navbar.css';
import {
		NavLink
} from 'react-router-dom';
import { MainContext } from '../../context/mainContext.js';

const Navbar = () => {

		const { main, dispatch } = useContext(MainContext);

		function clicked(item) {
		dispatch({type: `${item}Switch`})
		console.log(main);
		}; 

return(
		<div className='navbar'>
				<div className='logoContainer'><NavLink to='/'>Logo</NavLink></div>
				<ul className='menu'>
						<li><NavLink to='/about'>About</NavLink></li>
						<li><NavLink to='/skills'>Skills</NavLink></li>
						<li><NavLink to='/projects'>Projects</NavLink></li>
						<li><NavLink to='/contact'>Contact</NavLink></li>
				</ul>
				<div className='switch'>
						<button onClick={clicked('music')}>musicSwitch</button>
						<button onClick={clicked('theme')}>themeSwitch</button>
				</div>
		</div>
)};

export default Navbar;
